import { useState } from 'react';

const useLogin = () => {
  const [isLoggedIn, setLoggedIn] = useState(false);
  const [username, setUsername] = useState('');

  const login = (user) => {
    setLoggedIn(true);
    setUsername(user);
  };

  const logout = () => {
    setLoggedIn(false);
    setUsername('');
  };

  return {
    isLoggedIn,
    username,
    login,
    logout,
  };
};

export default useLogin;
